import React from "react";

export const Form = () => {
  return (
    <form>
      <input type="text" class="job-input" />
      <button class="submit-button" type="submit">
        Submit
      </button>
      <div class="sort">
        <select name="jobs" class="sort-jobs"></select>
      </div>
    </form>
  );
};
